namespace Hentul.UT
{
    using Hentul;
    using Moq;
    using System.Net.Sockets;

    public class ScreenGrabberTest
    {
        ScreenGrabber sg;
        Random rand;
        int count = 25;

        [SetUp]
        public void Setup()
        {
            rand = new Random();
        }


        [Test]
        public void TestProcessColorMap()
        {
            sg = new ScreenGrabber(count, true);

            sg.ProcessColorMap(10, 10, 20, 20);

            Assert.AreEqual(10, sg.BucketToData.Count);
        }

        [Test]
        public void MultipleInstanceTestFOM()
        {

            sg = new ScreenGrabber(count);

            for (int i = 0; i < count; i++)
            {

                Assert.That(sg.fomBBM[i].ApicalLineArray.Length, Is.EqualTo(100));

                Assert.AreEqual(4, sg.fomBBM[i].Columns[rand.Next(0, 9), rand.Next(0, 9)].Neurons[rand.Next(0, 9)].ProximoDistalDendriticList.Count);

                Assert.AreEqual(2, sg.fomBBM[i].Columns[rand.Next(0, 9), rand.Next(0, 9)].Neurons[rand.Next(0, 9)].AxonalList.Count);

                Assert.IsNotNull(sg.fomBBM[i].Columns[rand.Next(0, 9), rand.Next(0, 9)].Neurons[rand.Next(0, 9)].ProximoDistalDendriticList.ElementAt(rand.Next(0, 4)));

                Assert.IsNotNull(sg.fomBBM[i].Columns[rand.Next(0, 9), rand.Next(0, 9)].Neurons[rand.Next(0, 9)].AxonalList.ElementAt(rand.Next(0, 2)));

            }

        }

        [Test]
        public void TestGetNextCursorPosition()
        {
            sg = new ScreenGrabber(count);

            int iterations = 21;

            int range = count;

            POINT p;

            int i = 1;
            p.X = sg.LeftUpper.Item1;
            p.Y = sg.LeftUpper.Item2;
            

            while (sg.CurrentDirection == "RIGHT")
            {
                p = sg.GetNextCursorPosition(true, p.X, p.Y);

                if (sg.CurrentDirection == "DOWN")
                    break;

                if (p.X != sg.LeftUpper.Item1 + (i * 25))
                {
                    Assert.Fail();
                }
                i++;
            }

            i = 1;

            while (sg.CurrentDirection == "DOWN")
            {
                p = sg.GetNextCursorPosition(true, p.X, p.Y);

                if (sg.CurrentDirection == "LEFT")
                    break;

                if (p.Y != sg.LeftUpper.Item2 + (i * 25))
                {
                    Assert.Fail();
                }
                i++;
            }

            i = 1;
            while (sg.CurrentDirection == "LEFT")
            {
                p = sg.GetNextCursorPosition(true, p.X, p.Y);

                if (sg.CurrentDirection == "UP")
                    break;

                if (p.X != sg.RightBottom.Item1 - (i * 25))
                {
                    Assert.Fail();
                }
                i++;
            }

            i = 1;

            while (sg.CurrentDirection == "UP")
            {
                p = sg.GetNextCursorPosition(true, p.X, p.Y);

                if (sg.CurrentDirection == "RIGHT")
                {
                    p = sg.GetNextCursorPosition(true, p.X, p.Y);
                    break;
                }

                if (p.Y != sg.LeftBottom.Item2 - (i * 25))
                {
                    Assert.Fail();
                }
                i++;
            }

            Assert.AreEqual(sg.LeftUpper.Item1 + 2 * range, p.X);
            Assert.AreEqual(sg.LeftUpper.Item2 + range, p.Y);
        }

        [Test]
        public void TestNumberOfPixelsPerBBM()
        {
            sg = new ScreenGrabber(count, true);

            sg.ProcessColorMap(2000, 400, 2050, 450);
            //Assert.AreEqual( 10, sg.NumBuckets);

            Assert.AreEqual(250, sg.BucketToData.Count);
        }

